1. Takagi-Sugeno-Kang (TSK) fuzzy rule
\begin{align}
\text{If $x_1$ is $A$ and $x_2$ is $B$ then $y$ is $a_0 + a_1x_1 + a_2x_2$}
\end{align}

$\quad\quad\enspace \text{where $a_0$, $a_1$, $a_2$ are real numbers.}$


The rule consequent is a function – usually linear – of the input variables.
Therefore, each rule can be considered as a local linear model. The system output is the weighted average of the output of each rule.

Let us convert the system to a TSK system by replacing the three
linguistic consequents – cold, medium and hot – with corresponding,
accurately calculated linear functions of the input variables
The three rule consequents become:

* If the *month* is *low* OR the *humidity* is *wet*, then the *temperature* = $f_{1}(M,H)=2M + 0.8H - 40$
* If the *month* is *medium* OR the *humidity* is *normal* then the *temperature* = $f_{2}(M,H)=M + H - 23$
* If the *month* is *high* AND the *humidity* is *dry*, then the *temperature* = $f_{3}(M,H)=0.5M + 0.3H$
